<!doctype html>
<html lang="it">
<head>
<meta charset="utf-8" />

<title>Dottor Umberto Luca Marchica - Fisioterapista</title>
<style>
:root{--orange:#ff7a00;--teal:#46b69a;--card:#ffffffee;--accent:#0b6bd6;}
html,body{height:100%;margin:0;font-family:Inter,system-ui,-apple-system,"Segoe UI",Roboto,Helvetica,Arial;}
body{background: linear-gradient(135deg, var(--orange) 0 48%, var(--teal) 48% 100%);display:flex;align-items:center;justify-content:center;padding:20px;}
.container{width:100%;max-width:760px;position:relative;border-radius:14px;padding:18px;box-sizing:border-box;}
.card{background:var(--card);border-radius:12px;padding:20px;box-shadow:0 12px 30px rgba(0,0,0,0.12);}
.logo{position:absolute;right:22px;top:22px;width:110px;height:110px;display:flex;align-items:center;justify-content:center;}
.logo img{max-width:100%;max-height:100%;object-fit:contain;}
.header{text-align:center;margin-bottom:6px;}
.avatar{width:140px;height:140px;border-radius:50%;object-fit:cover;border:6px solid white;box-shadow:0 8px 20px rgba(0,0,0,0.15);display:block;margin:0 auto 8px;}
h1{margin:6px 0 0;font-size:20px;color:#073b34;font-weight:700;}
.subtitle{margin:0;font-size:14px;color:#073b34;opacity:0.95;}
form label{display:block;margin-top:10px;font-size:13px;color:#223;}
input[type=text],input[type=tel],textarea{width:100%;padding:10px;border-radius:8px;border:1px solid #d7dce9;margin-top:6px;font-size:14px;box-sizing:border-box;}
textarea{min-height:110px;resize:vertical;}
.row{display:flex;gap:10px;}
.row .half{flex:1;}
.btn{margin-top:14px;width:100%;padding:12px;border-radius:8px;border:0;background:var(--accent);color:#fff;font-size:15px;cursor:pointer;}
.note{font-size:13px;color:#444;margin-top:8px;text-align:center;}
.hidden{display:none;}
.thanks{text-align:center;padding:30px;color:#073b34;}
.thanks h2{font-size:24px;margin:0 0 6px;}
.footer{text-align:center;margin-top:12px;color:#073b34;font-size:13px;}

      <form id="contactForm">
        <div class="row">
          <div class="half"><label for="nome">Nome</label><input id="nome" name="nome" type="text" required></div>
          <div class="half"><label for="cognome">Cognome</label><input id="cognome" name="cognome" type="text" required></div>
        </div>
        <label for="posizione">Dove ti trovi</label>
        <input id="posizione" name="posizione" type="text" required>
        <label for="telefono">Recapito telefonico</label>
        <input id="telefono" name="telefono" type="tel" required>
        <label for="messaggio">Descrivi in breve il tuo problema</label>
        <textarea id="messaggio" name="messaggio" required></textarea>

        <input type="hidden" name="_subject" value="Richiesta di ricontatto dal sito">
        <button class="btn" type="submit">Invia richiesta</button>
        <p class="note">I tuoi dati saranno trattati con riservatezza.</p>
        <p id="formFeedback" class="note" role="status" aria-live="polite"></p>
      </form>
    </main>
    <footer class="footer"> Dott. Umberto Luca Marchica</footer>
  </div>

  <div class="card hidden" id="thanksCard" aria-hidden="true">
    <div class="thanks">
      <h2>Grazie! </h2>
      <p>La tua richiesta  stata inviata correttamente.<br>Ti ricontatteremo al pi presto.</p>
      <button class="btn" id="backBtn">Torna alla pagina principale</button>
    </div>
  </div>
</div>

<script>
const FORM_ENDPOINT = "https://formspree.io/f/mzzoblok";

function validate() {
  const nome = document.getElementById('nome').value.trim();
  const cognome = document.getElementById('cognome').value.trim();
  const pos = document.getElementById('posizione').value.trim();
  const tel = document.getElementById('telefono').value.trim();
  const msg = document.getElementById('messaggio').value.trim();
  if(!nome||!cognome||!pos||!tel||!msg) return "Compila tutti i campi.";
  const digits = tel.replace(/\D/g,'');
  if(digits.length<6) return "Inserisci un recapito telefonico valido.";
  return null;
}

document.getElementById('contactForm').addEventListener('submit', function(e){
  e.preventDefault();
  const fb = document.getElementById('formFeedback');
  fb.textContent = '';
  const err = validate();
  if(err){ fb.textContent = err; fb.style.color = '#b91c1c'; return; }
  const data = {
    nome: document.getElementById('nome').value.trim(),
    cognome: document.getElementById('cognome').value.trim(),
    posizione: document.getElementById('posizione').value.trim(),
    telefono: document.getElementById('telefono').value.trim(),
    messaggio: document.getElementById('messaggio').value.trim(),
    _subject: 'Richiesta di ricontatto dal sito'
  };
  fb.textContent = 'Invio in corso...';
  const formBody = Object.keys(data).map(k => encodeURIComponent(k)+'='+encodeURIComponent(data[k])).join('&');
  fetch(FORM_ENDPOINT, {
    method: 'POST',
    headers: {'Content-Type':'application/x-www-form-urlencoded','Accept':'application/json'},
    body: formBody
  }).then(r=>{
    if(r.ok) return r.json().catch(()=>{});
    return r.json().then(err=>Promise.reject(err)).catch(()=>Promise.reject());
  }).then(()=>{
    document.getElementById('mainCard').classList.add('hidden');
    document.getElementById('thanksCard').classList.remove('hidden');
    document.getElementById('thanksCard').setAttribute('aria-hidden','false');
  }).catch(()=>{
    fb.textContent = "Errore nell'invio. Riprova pi tardi.";
    fb.style.color = '#b91c1c';
  });
});

document.getElementById('backBtn').addEventListener('click', function(){
  document.getElementById('thanksCard').classList.add('hidden');
  document.getElementById('mainCard').classList.remove('hidden');
  document.getElementById('thanksCard').setAttribute('aria-hidden','true');
  document.getElementById('contactForm').reset();
});
</script>
</body>
</html>
